import styles from "./Files.module.css";

export default function Files({ files }) {
    return (<div className={`${styles.filesBlock}`}>
        {files.map(f => (
            <div key={f.id} className={styles.fileBlock}>
                {f.name}<br />
                <span>{Math.round(f.file.size / 1000)} KB</span>
            </div>
        ))}
    </div>);
}
